INSERT INTO `game` (`id`, `league_id`, `name`, `status`, `team_num`, `brief_info`, `instructions`, `term_isRead`, `transfer_isOn`, `transfer_rule`, `reserve_rule`, `reserve_isOn`, `reserve_limit`, `player_rule`, `player_isOn`, `player_limit`, `scoring`, `created_at`, `updated_at`) VALUES
(1, 1, 'Wildcard', 0, 2, 'This is a Fantasy League for M5 World Championship, stage Wildcard, involving eight (8) qualified teams from around the world, to get the chance to participate in Group Stage M5 World Championship. This tournament takes place from 23rd to 26th November 2023 in Kuala Lumpur, Malaysia.', '// For the first half of this fantasy league (before the transfer window), participants must create one (1) team for each group (A and B). // Each team consists of only five (5) main players for every role. // After the transfer window, only one (1) team will remain, consisting of five (5) main players and two (2) substitute players. // For each group, don’t forget to assign your captain and vice-captain to double your point! // Please create your team before 10.00pm (MYT) 22nd November 2023.\n', 1, 0, '// There will be a transfer window for this stage. // Transfer window will be opened for 12 hours from 12.00am (MYT) 26th November to 12.00pm (MYT) 26th November 2023. // If you do not update your team during this transfer window, your team will not be registered for crossover matches (4th day).', '// Before the transfer window, there is no substitute players. // After the transfer window, there are two (2) substitute players allowed to choose.\r\n', 0, 2, '// Maximum of three (3) players from the same team is allowed.', 0, 3, '// Your team’s score consists of individual score from each player you selected. The better the performance of your players, the higher the chances for your team to win! // Individual score for each player is based on their KDA point, MVP point, bonus point (triple kills, maniac, savage) and team winning point. // May the best fantasy MLBB team win, play along!\r\n', '2023-11-16 16:47:36', '2023-11-26 20:13:04'),
(2, 1, 'Group Stage', 0, 4, 'This is a Fantasy League for M5 World Championship, Group Stage, involving sixteen (16) qualified teams from around the world, to get the chance to participate in Knockout stage of M5 World Championship. This tournament takes place from 2nd to 7th December 2023 in Philippines.', '// In this tournament, participants need to create a team for each group. In total, there will be four (4) fantasy team for you to create. // Each team consists of only five (5) main players without any substitute players. // For each group, don’t forget to assign your captain and vice-captain to double your point! // Please create your team before 10.00pm (MYT) 1st December 2023\r\n', 1, 0, '// There is no transfer window for this stage.', '// No substitute players allowed for this stage.', 0, 0, '// Maximum of three (3) players from the same team is allowed.', 0, 3, '// Your team’s score consists of individual score from each player you selected. The better the performance of your players, the higher the chances for your team to win! // Individual score for each player is based on their KDA point, MVP point, bonus point (triple kills, maniac, savage) and team winning point. // May the best fantasy MLBB team win, play along!\r\n', '2023-11-16 16:54:46', '2023-12-03 06:55:42'),
(3, 2, 'Knockout', 0, 1, 'This is a Fantasy League for M5 World Championship, stage Knockout, involving eight (8) remaining top teams from around the world, to compete in this last stage and win the 5th MLBB World Championship. This tournament takes place from 9th to 16th December 2023 in Philippines.', '// For the first half of this fantasy league (before the transfer window), participants must create one (1) team from eight (8) participating teams. // Each team consists of five (5) main players and five (5) substitute players. // After the transfer window, your remaining players will remain in your team. // You can change the eliminated players with new players but, there will be only 3 substitute players are allowed. // For each group, don’t forget to assign your captain and vice-captain to double your point! // Please create your team before 10.00pm (MYT) 8th December 2023.\n', 1, 0, '// There will be a transfer window for this stage. // Transfer window will be opened for 12 hours from 12.00am (MYT) 13th December to 12.00pm (MYT) 14th December 2023. // If you do not update your team during the transfer window, only the remaining players will remain in your new lineup.\n', '// Before the transfer window, there are five (5) substitute players. // After the transfer window, there are only three (3) substitute players allowed to choose.\n', 1, 3, '// Before the transfer window, maximum of two (2) players from the same team is allowed. // After the transfer window, maximum of three (3) players from the same team is allowed.\n', 1, 3, '// Your team’s score consists of individual score from each player you selected. The better the performance of your players, the higher the chances for your team to win! // Individual score for each player is based on their KDA point, MVP point, bonus point (triple kills, maniac, savage) and team winning point. // May the best fantasy MLBB team win, play along!\n', '2023-11-16 16:54:46', '2024-02-04 11:55:11');
